DROP PROCEDURE IF EXISTS monthly_by_type;
DELIMITER //

CREATE PROCEDURE monthly_by_type(IN mth INT(2), IN yr INT(4))
BEGIN
  
    SELECT t.name, COUNT(*) AS total
  FROM azwh_accessions as a, azwh_patients as p, azwh_taxon as t
  WHERE a.patient_id=p.id 
  AND p.taxon_id_vet=t.id
  AND MONTH(a.date_admitted)=mth
  AND YEAR(a.date_admitted)=yr
  GROUP BY t.name
  ORDER BY total DESC;

END //
DELIMITER ;


DROP PROCEDURE IF EXISTS monthly_by_juris;
DELIMITER //

CREATE PROCEDURE monthly_by_juris(IN mth INT(2), IN yr INT(4))
BEGIN
  
    SELECT j.name, COUNT(*) AS total
  FROM azwh_accessions as a, azwh_jurisdictions as j
  WHERE a.rescue_jurisdiction_id=j.id 
  AND MONTH(a.date_admitted)=mth
  AND YEAR(a.date_admitted)=yr
  GROUP BY j.name
  ORDER BY total DESC;

END //
DELIMITER ;

call monthly_by_juris(1,2018);


DROP PROCEDURE IF EXISTS monthly_prev_months;
DELIMITER //
CREATE PROCEDURE monthly_prev_months(IN mth INT(2), IN yr INT(4))
BEGIN
  DECLARE start_date date;
    DECLARE end_date date;
    ## We want to make sure we include the current month but is easiest
    # to set to 1st of month, and then add a month, than work out the end
    # of the month
    SET end_date = DATE_ADD(CONCAT(yr,'-',mth,'-01'), INTERVAL 1 MONTH);
    SET start_date = DATE_SUB(end_date, INTERVAL 13 MONTH);
    
    SELECT MONTH(a.date_admitted), YEAR(a.date_admitted), COUNT(*) AS total
  FROM azwh_accessions as a
  WHERE a.date_admitted > start_date
  AND a.date_admitted < end_date
  GROUP BY MONTH(a.date_admitted), YEAR(a.date_admitted)
  ORDER BY YEAR(a.date_admitted), MONTH(a.date_admitted) ASC;

END //
DELIMITER ;

#call monthly_prev_months(1,2018);

DROP PROCEDURE IF EXISTS get_all_suburbs;
DELIMITER //
CREATE PROCEDURE get_all_suburb()
BEGIN
  
    SELECT id as suburb_id, name, postcode, jurisdiction_id
  FROM azwh_suburbs as s;

END //
DELIMITER ;

DROP PROCEDURE IF EXISTS get_all_species;
