END //
DELIMITER ;

DROP PROCEDURE IF EXISTS add_or_get_rescuer;
DELIMITER //
CREATE PROCEDURE add_or_get_rescuer(
IN first_name varchar(50),
IN last_name varchar(50),
IN title varchar(50),
IN phone varchar(20),
in mobile varchar(50),
in email varchar(50),
in address1 varchar(50),
in suburb_id int(11))
BEGIN
  DECLARE rescuer_id int(11);
  SELECT id INTO rescuer_id from azwh_contacts 
  WHERE firstname=first_name 
  AND lastname=last_name
  AND salutation=title;

  IF rescuer_id IS NULL THEN
    INSERT into azwh_contacts (firstname, lastname, salutation, phone, mobile, email, address1, suburb_id, contact_category_id)
    VALUES (first_name, last_name, title, phone, mobile, email, address1, suburb_id, 11);
    SELECT id INTO rescuer_id from azwh_contacts 
        WHERE firstname=first_name 
        AND lastname=last_name
        AND salutation=title;
  END IF;

  select rescuer_id;

END //
DELIMITER ;

#call add_or_get_rescuer('Erica', 'Mealy', 'Dr', '0754594484','0400123456', 'name@email.com', '1 Moreton Parade',1883);

## Pre-requiste - rescuer, species, suburb and jurisdiction ID have been worked out.
DROP PROCEDURE IF EXISTS create_accession;
DELIMITER //
CREATE PROCEDURE create_accession(
IN rescuer_id int(10),
IN species_id int (10),
IN animal_name varchar(50),
IN date_admitted DATE, 
IN time_admitted TIME, 
IN admitter_signoff enum('Y','N',''), 
IN can_call enum('Y','N',''), 
IN registered_carer enum('Y','N',''),
IN interested_in_becoming enum('Y','N',''),
IN rescue_suburb_id int (11), 
IN rescue_juris_id int(11), 
IN rescue_situation varchar(255), 
IN rescue_reason varchar(255), 
IN time_in_capt varchar(255), 
IN fed_medicated enum('Y','N'), 
IN fed_what varchar(255), 
IN fed_when varchar(255),
IN affliction varchar(255))
BEGIN
  DECLARE next_acc_num int;
    DECLARE patient_id int (10);
    DECLARE taxonid int(11);

    SELECT MAX(CAST(accession_number AS UNSIGNED)) INTO next_acc_num FROM azwh_accessions;
    SET next_acc_num = next_acc_num + 1;
 
    SELECT taxon_id INTO taxonid from azwh_species WHERE id=species_id;
    
    INSERT into azwh_patients(name, species_id_vet, taxon_id_vet)
    VALUES (animal_name, species_id, taxonid);
    SELECT MAX(id) INTO patient_id from azwh_patients WHERE name=animal_name AND species_id_vet=species_id;

    INSERT into Azwh_accessions(create_ts, last_modified_ts, accession_number, date_admitted, time_admitted, rescuer_id, patient_id, 
              admitter_signoff, can_call_admitter, registered_wildlife_carer,
              interested_in_becoming_carer, rescue_suburb_id, rescue_jurisdiction_id,
                            rescue_situation, rescue_reason, 
                            accession_reason_id, time_in_captivity, fed_medicated, fed_what, fed_when)
    VALUES(now(), now(),next_acc_num, date_admitted, time_admitted, rescuer_id, patient_id, admitter_signoff, can_call, registered_carer,
              interested_in_becoming, rescue_suburb_id, rescue_juris_id, rescue_situation, rescue_reason, 
                            1, time_in_capt, fed_medicated, fed_what, fed_when);

    select next_acc_num;
END //
DELIMITER ;

